import React from 'react';



function App({posts}) {
    console.log(posts)
  return (
      <>
        {posts.map(repo => (
            <h1 key={repo.id}>{repo.name}</h1>
        ))}
      </>
  );
}


export async function getStaticProps() {
    const res = await fetch("https://api.github.com/orgs/rocketseat/repos")
    const posts = await res.json()
  
    return {
      props: {
        posts,
      },
    }
  }


export default App;
